import axios from "axios"
import { useState } from "react"
import { useNavigate } from "react-router-dom"

const URI ='http://localhost:8000/canchas/'

const CompCreateCancha = () => {
    //Configurando Hooks
    const [deportivoName, setDeportivoName] = useState('');
    const [canchaName, setCanchaName] = useState('');
    const [encargadoName, setEncargadoName] = useState('');
    const [encargadoPhone, setEncargadoPhone] = useState('');
    const [encargadoPosition, setEncargadoPosition] = useState('');
    const [encargadoRFC, setEncargadoRFC] = useState('');
    const [dirCalle, setDirCalle] = useState('');
    const [dirNumero, setDirNumero] = useState('');
    const [dirColonia, setDirColonia] = useState('');
    const [dirCP, setDirCP] = useState('');
    const [dirAlcaldia, setDirAlcaldia] = useState('');
    const [dirEntreCalles, setDirEntreCalles] = useState('');
    const [dirReferencias, setDirReferencias] = useState('');
    const [condicion, setCondicion] = useState('');
    const [coordinates, setCoordinates] = useState('');
    //Definimos la navegacion
    const navigate = useNavigate()

    //Procedemos a guardar los valores

    const store = async (e) => {
        e.preventDefault() //Prevenimos interaccion con el submit
        //Enviamos los datos del formulario al backend con post
        await axios.post(URI, {deportivoName: deportivoName, canchaName: canchaName, encargadoName: encargadoName,
            encargadoPhone: encargadoPhone, encargadoPosition: encargadoPosition, encargadoRFC: encargadoRFC,
            dirCalle: dirCalle, dirNumero: dirNumero, dirColonia: dirColonia, dirCP: dirCP, dirAlcaldia: dirAlcaldia,
            dirEntreCalles: dirEntreCalles, dirReferencias: dirReferencias, condicion:condicion, coordinates:coordinates        
        })
        //Una vez guardado todo nos manda a la ruta raiz
        navigate('/')
    }
    //Generamos formulario
    return (
        <div>
            <h1>Ingresar nueva cancha</h1>
            <form onSubmit={store}>
                <div className="mb-3">
                    <label className='form-label'>Nombre del Deportivo</label>
                    <input
                        value={deportivoName}
                        onChange={ (e) => setDeportivoName(e.target.value)}
                        type="text"
                        className="form-control"
                    />
                </div>
                <div className="mb-3">   
                <label className='form-label'>Tipo de Cancha</label>             
                    <textarea
                        value={canchaName}
                        onChange={ (e) => setCanchaName(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>
                <div className="mb-3">  
                <h2>Informacion del encargado</h2>
                <label className='form-label'>Nombre del encargado</label>              
                    <textarea
                        value={encargadoName}
                        onChange={ (e) => setEncargadoName(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>
                <div className="mb-3">  
                <label className='form-label'>Teléfono del encargado</label>              
                    <textarea
                        value={encargadoPhone}
                        onChange={ (e) => setEncargadoPhone(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>
                <div className="mb-3">   
                <label className='form-label'>Posición</label>             
                    <input
                        value={encargadoPosition}
                        onChange={ (e) => setEncargadoPosition(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>
                <div className="mb-3">  
                <label className='form-label'>RFC</label>                              
                    <textarea
                        value={encargadoRFC}
                        onChange={ (e) => setEncargadoRFC(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>
                <div className="mb-3"> 
                <h1>Ingresar nueva cancha</h1>              
                <label className='form-label'>Calle</label>               
                    <textarea
                        value={dirCalle}
                        onChange={ (e) => setDirCalle(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>    
                <div className="mb-3">                
                    <textarea
                        value={dirNumero}
                        onChange={ (e) => setDirNumero(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>     
                <div className="mb-3">                
                    <textarea
                        value={dirColonia}
                        onChange={ (e) => setDirColonia(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>    
                <div className="mb-3">                
                    <textarea
                        value={dirCP}
                        onChange={ (e) => setDirCP(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>           
                <div className="mb-3">                
                    <textarea
                        value={dirAlcaldia}
                        onChange={ (e) => setDirAlcaldia(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>           
                <div className="mb-3">                
                    <textarea
                        value={dirEntreCalles}
                        onChange={ (e) => setDirEntreCalles(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>         
                <div className="mb-3">                
                    <textarea
                        value={dirReferencias}
                        onChange={ (e) => setDirReferencias(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>         
                <div className="mb-3">                
                    <textarea
                        value={condicion}
                        onChange={ (e) => setCondicion(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>    
                <div className="mb-3">                
                    <textarea
                        value={coordinates}
                        onChange={ (e) => setCoordinates(e.target.value)}
                        type="text"
                        className="form-control"
                    />                
                </div>                                                                                                                                                       
            </form>
        </div>
    )}   

export default CompCreateCancha
